  return (
    <>
      <h3>History</h3>
      <ul id="list" className="list">
        <li classNameName="minus">
          Cash <span>-$400</span><button className="delete-btn">x</button>
        </li> 
      </ul>
    </>
  )
}

export default Transactionlist
